package weatherapi2.weatherapi2;

public class Coord {
	
	private Double lat;
	
	private Double lon;
	
	public Coord() {
		// TODO Auto-generated constructor stub
	}

	public Double getLat() {
		return lat;
	}

	public void setLat(Double lat) {
		this.lat = lat;
	}

	public Double getLon() {
		return lon;
	}

	public void setLon(Double lon) {
		this.lon = lon;
	}
	
	

}
